import React from "react";

export default function Login_SingUp(){
    return(
        <div className="bg-white shadow-md w-64 h-48 rounded-md">
 <div className="grid grid-cols-4 gap-4">
      <div className="bg-blue-200 p-4">العمود الأول</div>
      <div className="bg-green-200 p-4">العمود الثاني</div>
      <div className="bg-red-200 p-4">العمود الثالث</div>
      <div className="bg-yellow-200 p-4">العمود الرابع</div>
    </div>
        </div>
    );
}
